var menu=document.getElementsByClassName("menu")[0],openMenuButton=document.getElementById("open-menu-button"),closeMenuButton=document.getElementById("close-menu-button");openMenuButton.addEventListener("click",()=>{menu.classList.add("active")}),closeMenuButton.addEventListener("click",()=>{menu.classList.remove("active")});
async function login(t="",o=""){const a=await fetch("http://localhost:3000/user/login",{method:"POST",headers:{Accept:"application/json","Content-Type":"application/json"},body:JSON.stringify({email:t,password:o})}),n=await a.json();return{ok:202===a.status,body:n}}async function register(t,o,a,n){const s=await fetch("http://localhost:3000/user/create",{method:"POST",headers:{Accept:"application/json","Content-Type":"application/json"},body:JSON.stringify({name:t,"cpf-cnpj":o,email:n,password:a})}),e=await s.json();return{ok:201===s.status,body:e}}